import{_ as e,o as r,c as t,O as a}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 46.2-1503.3 Motor Vehicle Dealer Board Fund; receipts; disbursements.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-1503.3.md","filePath":"vacode/46.2-1503.3.md"}'),o={name:"vacode/46.2-1503.3.md"},i=a('<h1 id="§-46-2-1503-3-motor-vehicle-dealer-board-fund-receipts-disbursements" tabindex="-1">§ 46.2-1503.3 Motor Vehicle Dealer Board Fund; receipts; disbursements. <a class="header-anchor" href="#§-46-2-1503-3-motor-vehicle-dealer-board-fund-receipts-disbursements" aria-label="Permalink to &quot;§ 46.2-1503.3 Motor Vehicle Dealer Board Fund; receipts; disbursements.&quot;">​</a></h1><p>The Motor Vehicle Dealer Board Fund is established as a special fund in the state treasury. Except as otherwise provided in this chapter, all fees collected as provided in this chapter and by regulations promulgated by the Board, shall be paid into the state treasury immediately upon collection and credited to the Motor Vehicle Dealer Board Fund. Any interest income shall accrue to the Motor Vehicle Dealer Board Fund. All disbursements from the Fund shall be made by the State Treasurer upon warrants of the Comptroller issued upon vouchers signed by an authorized officer of the Board or the Executive Director as authorized by the Board.</p><p>1995, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0767" target="_blank" rel="noreferrer">767</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0816" target="_blank" rel="noreferrer">816</a>; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0325" target="_blank" rel="noreferrer">325</a>.</p>',3),s=[i];function d(n,l,c,h,u,p){return r(),t("div",null,s)}const m=e(o,[["render",d]]);export{f as __pageData,m as default};
